import EmpData from "./EmpData";
// import EmpForm from "./EmpForm";
import { BrowserRouter as Router,Routes,Route } from "react-router-dom";
function App(){
    return(
        <div>
            <Router>
                <Routes>
                    <Route path="/" element={<EmpData/>}/>
                    {/* <Route path="/empform" element={<EmpForm/>}/> */}
                </Routes>
            </Router>

        </div>
    )
}
export default App;
